Description:
The Ordinary Natural moisturising factors &amp; HA is the Ordinary's true signature moisturiser, containing hyaluronic acid that draws moisture to the skin surface, supporting the effects of the moisturising factors to give the skin maximum hydration. Many of the Ordinary's moisture promoting products work in combination with this moisturiser and are not necessarily true moisturisers when use as stand alone products. Ideal to be use morning and night and great to combine with the ordinary serums and oils.

This non-greasy formula is made up of multiple amino acids, fatty acids, triglycerides, urea, ceramides, phospholipids, glycerin, saccharides, sodium PCA, hyaluronic acid and many other compounds that are naturally present in the skin.

&nbsp;

The Ordinary Hyaluronic acid and B5  contains low, medium and high molecular weight  Hyaluronic acid  to target different layer of the skin to draw moisture to it and improve   skin hydration.  The addition of vitamin B5 which also enhances surface hydration.

This makes a great daily moisturiser for the day or night and may be combined with oils or true moisturisers in the ordinary range, like moisturising factors &amp; HA for maximum hydrating benefit.

&nbsp;

The Ordinary Matrixyl 10% &amp; HA is an antioxidant serum that can reduce the appearance of wrinkles.

The Matrixyl is a proprietary peptide formula while hyaluronic acid draws moisture to the skin to improve hydration. This product is not a true moisturiser and does need to be combined with a good hydration formula to allow it to do its best job on your skin.

&nbsp;

&nbsp;

&nbsp;

The Ordinary Argireline Solution 10% is a lightweight serum that targets appearance of dynamic face lines.

This solution contains argireline an anti ageing peptide which is a trademark owned by Barcelona based Lipotec. Argireline studies have shown it improves the appearance of facial dynamic folds , including areas around the forehead and eyes.

&nbsp;

The duo set contains a <em>Copper Amino Isolate Serum</em> and a <em>Copper Amino Isolate Activator</em> that are designed to be mixed together.

This formula also soothes and calms skin, and is suitable for all skin types.

&nbsp;

Short description:
A glycerine based  flower remedy formulated by classical homeopath Alexis Smart, to assist with anxiety worry and everyday fears as well as insomnia.

Alcohol free formula.

&nbsp;

A glycerine based  flower remedy formulated by classical homeopath Alexis Smart, to assist with finding your calling, indecisions at crossroads, lack of ambition, boredom, dissatisfaction and those who are experiencing an unfulfilling career and need direction.

Alcohol free formula.

&nbsp;

A glycerine based  flower remedy formulated by classical homeopath Alexis Smart, to assist with depression, hopelessness, despair, apathy and melancholy during winter months.

Alcohol free formula.

&nbsp;

A glycerine based  flower remedy formulated by classical homeopath Alexis Smart, to assist with overwhelming responsibility, stress, tension and exhaustion.

Ideal for caregivers and workaholics.

Alcohol free formula.

&nbsp;

&nbsp;

&nbsp;

A glycerine based  flower remedy formulated by classical homeopath Alexis Smart, to assist with heartbreak &amp; grief. Ideal for those who have never recovered from a loss or trauma, however long ago it occurred.

A great foundational formula to use before using other remedies in this range.

Alcohol free formula.

&nbsp;

&nbsp;

A  daily exfoliating cleanser containing 0.5% Salicylic acid.  Gently cleans  without strippping natural oils or causing tightening of the skin after use.

A COSRX hero product ideal for oily or acne prone skin.

&nbsp;

Description:
Handcrafted in New Zealand, <em>Real World</em> is a botanical skincare line safe for the whole family. Every formula maximises the potent benefits of New Zealand's native flora and fauna, and is devoid of any parabens, and sodium lauryl and laureth sulfate.

The brand's?<em>Kaffir Lime and Peppermint Dishwashing Liquid?</em>effectively cleans dishes whilst leaving a refreshing scent. The minimal ingredients will not dry out your hands, but rather give it a revitalising citrus minty scent.

&nbsp;

Short description:
Sheer nude pink lip and cheek tint with peachy undertones, made with organic ingredients in Sweden.

&nbsp;

&nbsp;

A semi sheer classic rose pink lip and cheek tint, made with organic ingredients in Sweden.

&nbsp;

&nbsp;

A vibrant poppy coral red lip and cheek tint, made with organic ingredients in Sweden.

&nbsp;

&nbsp;

A cool-toned semi-matte currant lip and cheek tint, made with organic ingredients in Sweden.

&nbsp;

&nbsp;

A modern nude satin with brown undertones nourishing lipstick, made with organic ingredients in Sweden.

&nbsp;

&nbsp;

A true Hollywood red lipstick in a semi matte finish, made with organic ingredients in Sweden.

&nbsp;

&nbsp;

A soft lavender rose illuminating cream with a shimmering luminescence, made from organic ingredients in Sweden.

&nbsp;

&nbsp;

A vintage champagne illuminating cream with a pearl luminescence, made from organic ingredients in Sweden.

&nbsp;

&nbsp;

An earthy brown eye and cheek cream with a bronze lustre, made from organic ingredients in Sweden.

&nbsp;

&nbsp;

A dimmed rosy pink shade with a gentle luminosity and a natural cream finish, made from organic ingredients in Sweden.

&nbsp;

&nbsp;

An illuminating sand gold with peachy undertones and a cream finish, made from organic ingredients in Sweden.

&nbsp;

&nbsp;

An intensely pigmented sunset-hued cream, made from organic ingredients in Sweden.

&nbsp;

&nbsp;

Description:
The Ordinary vitamin C formula is a high-strength treatment designed to fight the signs of UV damage. Consistent use reduces the signs of ageing such as sunspots and fine lines, as well as protecting your skin against any future signs of sun and environmental damage.

The vitamin C is suspended in vitamin F also a strong antioxidant  which boasts essential fatty acids to plump the skin and soften fine lines.

&nbsp;

Established in 1965, <em>Baxter of California</em> is an award-winning men's grooming and personal care range. The brand's <em>Super Shape Skin Recharge </em>is a lightweight, fast-absorbing gel cream formulated with caffeine and plant extracts to revitalise tired skin, reduce the appearance of fine lines, and improve skin texture.

Signature ingredients include:
<ul>
 	<li><strong>Caffeine: </strong>constricts blood vessels and soothes the skin, resulting in decreased redness.</li>
 	<li><strong>Apricot kernel oil:</strong> deeply penetrates skin to moisturise dry, itchy, or wounded skin without leaving a greasy residue. It also smoothes out fine lines and blemishes.</li>
</ul>
This moisturiser is formulated without fragrances, and is ideal for sensitive skin.

&nbsp;

&nbsp;

&nbsp;

Established in 1965, <em>Baxter of California</em> is an award-winning men's grooming and personal care range. The brand's <em>Exfoliating Body Bar</em><em>?</em>is an effective cleansing scrub that removes rough skin patches and dirt, whilst nourishing the skin.

Signature ingredients include:
<ul>
 	<li><strong>Pumice, jojoba meal and olive seed: </strong>a gentle exfoliating combination to remove patches of dry, flaky skin and impurities on the skin.</li>
 	<li><strong>Coconut acid:</strong> contains anti-inflammatory properties to soothe the skin whilst also providing hydration.</li>
</ul>
We love the earthy-woody scent of cedarwood and oakmoss.

&nbsp;

&nbsp;

&nbsp;

Established in 1965, <em>Baxter of California</em> is an award-winning men's grooming and personal care range. The brand's<em> Invigorating Body Wash (Lime and Pomegranate)</em> is a paraben and sulfate free formula that offers a thorough cleanse without stripping the body of moisture.

Subtly scented with refreshing lime and pomegranate, this wash is the perfect pick-me-up in the morning.

&nbsp;

&nbsp;

&nbsp;

&nbsp;

Established in 1965, <em>Baxter of California</em> is an award-winning men's grooming and personal care range. The brand's<em> Invigorating Body Wash (Lime and Pomegranate)</em> is a paraben and sulfate free formula that offers a thorough cleanse without stripping the body of moisture.

The iconic citrus and herbal musk scent delivers a refreshing aroma with depth and warmth.

&nbsp;

&nbsp;

&nbsp;

&nbsp;

Established in 1965, <em>Baxter of California</em> is an award-winning men's grooming and personal care range. The brand's <em>Hand and Body Moisturiser</em> boasts a combination of plant-based moisturisers, natural oils, vitamins and botanical extracts to restore the skin's moisture barrier, leaving skin feeling smooth and refreshed without a greasy residue.

<strong>Key ingredients include:</strong>
<ul>
 	<li><strong>Sunflower seed oil:</strong> rich in vitamin E, nutrients, and antioxidants to effectively treat inflamed, dry, or irritated skin.</li>
 	<li><strong>Safflower seed oil:</strong> rich in fatty acids to restore skin's moisture, and has effective cleansing properties.</li>
 	<li><strong>Coconut oil:</strong> moisturises skin and can protect skin from harmful bacterial.</li>
 	<li><strong>Honeysuckle extract:</strong> effective for cleansing skin.</li>
</ul>
Has fresh citrus and herbal-musk scent.

&nbsp;

&nbsp;

&nbsp;

&nbsp;

